import React, {useState, useEffect} from 'react';
import './App.css';
import Firstprofile from './components/Firstprofile';
import Firstresult from './components/Firstresult';
import Finalresult from './components/Finalresult';
import Secondprofile from './components/Secondprofile';
import Secondresult from './components/Secondresult';

function App() {
  const [firstProfile, setFirstProfile] = useState()
  const [secondProfile, setSecondProfile] = useState()
  const [firstResult, setFirstResult] = useState()
  const [secondResult, setSecondResult] = useState()
  return (
    <div className="App">
     <Firstresult firstResult = {firstResult} setFirstResult = {setFirstResult} />
    <Finalresult />
    <Firstprofile firstProfile = {firstProfile} setFirstProfile= {setFirstProfile}/>
    <Secondprofile secondProfile = {secondProfile} setSecondProfile = {setSecondProfile}/>
    <Secondresult 
    secondResult= {secondResult} setSecondResult= {setSecondResult}
    secondProfile = {secondProfile} setSecondProfile = {setSecondProfile}/>

    </div>
  );
}

export default App;
